import { NavLink } from 'react-router-dom';

import './style.css';

export default function AccountNavBar() {
  return (
    <div className="navbar-wrap">
        <ul>
          <li><Home /></li>
          <li><PersonalInfo /></li>
          <li><DataPrivacy /></li>
        </ul>
    </div>
  )
}

const Home = () => (
  <NavLink
    end to="/myaccount/" 
    className={({isActive}) => 
      (isActive ? "sidebar-item-active no-deco" : "sidebar-item no-deco")
    }
  >
      <div className="sidebar-links">
        Home
      </div>
  </NavLink>
)

const PersonalInfo = () => (
  <NavLink
    end to="/myaccount/personalinfo/" 
    className={({isActive}) => 
      (isActive ? "sidebar-item-active no-deco" : "sidebar-item no-deco")
    }
  >
      <div className="sidebar-links">
        Personal info
      </div>
  </NavLink>
)

const DataPrivacy = () => (
  <NavLink
    end to="/myaccount/data-and-personalization/"
    className={({isActive}) => 
      (isActive ? "sidebar-item-active no-deco" : "sidebar-item no-deco")
    }
  >
      <div className="sidebar-links">
        Data & Privacy
      </div>
  </NavLink>
)
